     }
     {this.state.logoURL}
     {this.state.backURL}
  }*/
  divStyle = {
    display: 'inline'
  }
  hStyle = {
    fontSize:'70px'
  }
  icon1Style = {
    position: 'absolute',
    top:'65%',
    left:'42.5%'
  }
  icon2Style = {
    position: 'absolute',
    top:'65%',
    right:'45%'

  }
  render () {
    return (
      <div>
      <header>
      <div style ={this.divStyle}>
        <img src={logo} className="logo" />
      </div>

      </header>
    <div className="container">
      <img  src={background} className="img"/>
      <h1 className="center" style={this.hStyle}>WELCOME TO THE BANK OF THE SUN</h1>
      <center>
      <img className="icon " src= {icon} style={this.icon1Style}/>
      <img className="icon " src={contact} style={this.icon2Style}/>
      </center>
    </div>
      </div>

    );

  }
}

export default Welcome;
